    <Grid container spacing={2}>
      <Grid item xs={4}></Grid>
      <Grid item xs={4}>
        <Grid container spacing={2}>
          <Grid sx={{ backgroundColor: "lightgray" }} item xs={6}>
            <h3>Category Name:-</h3>
          </Grid>
        </Grid>
      </Grid>
      <Grid item xs={4}></Grid>
    </Grid>
  );
};
